pcall(vim.cmd, [[command -nargs=* -range -bang -complete=file SymbolsOutline lua require("packer.load")({'symbols-outline.nvim'}, { cmd = "SymbolsOutline", l1 = <line1>, l2 = <line2>, bang = <q-bang>, args = <q-args>, mods = "<mods>" }, _G.packer_plugins)]])
time([[Defining lazy-load commands]], false)

vim.cmd [[augroup packer_load_aucmds]]
vim.cmd [[au!]]
  -- Event lazy-loads
time([[Defining lazy-load event autocommands]], true)
vim.cmd [[au BufRead * ++once lua require("packer.load")({'nvim-bqf', 'numb.nvim', 'modes.nvim', 'lsp_signature.nvim', 'gitsigns.nvim', 'lightspeed.nvim', 'todo-comments.nvim', 'Comment.nvim', 'sidebar.nvim', 'nvim-ufo', 'fidget.nvim'}, { event = "BufRead *" }, _G.packer_plugins)]]
